import React from 'react';
import Style from './cards.module.css'

const Card = () => {
  return (
    <div className={Style.cardStyle}>
      {/* Conte√∫do do card */}
    </div>
  );
};

const App = () => {
  return (
    <div>
      <Card />
      <Card />
      <Card />
    </div>
  );
};

export default App;
